# How can a webapp communicate between two browser tabs?

You can use the BroadcastChannel API. It's a new API, but there is a polyfill for it.

Example:

On the first page:
// Connection to a broadcast channelconst bc = new BroadcastChannel('test_channel');bc.postMessage('This is a test message.');
On the second page:
// Connection to a broadcast channelconst bc = new BroadcastChannel('test_channel');// A handler that only logs the event to the console:bc.onmessage = function (ev) { console.log(ev); }
If you want one-way communication, you can use localStorage. When a tab modifies localStorage, the other tabs receive the storage event. You can use this to pass messages. For example:

Tab 1:
localStorage.setItem('message', 'hello');
Tab 2:
window.addEventListener('storage', function(e) {    if (e.key === 'message') {        console.log(e.newValue); // hello    }});
Note that this only works if both tabs are on the same domain.

